        int N = sc.nextInt();
        int M = sc.nextInt();

        int[] H = new int[N + 1];
        for (int i = 1; i <= N; i++) {
            H[i] = sc.nextInt();
        }

        List<List> adj = new ArrayList<>();
        for (int i = 0; i <= N; i++) {
            adj.add(new ArrayList<>());
        }

        for (int i = 0; i < M; i++) {
            int a = sc.nextInt();
            int b = sc.nextInt();
            adj.get(a).add(b);
            adj.get(b).add(a);
        }

        int count = 0;
        for (int i = 1; i <= N; i++) {
            boolean isGood = true;
            for (int neighbor : adj.get(i)) {
                if (H[i] <= H[neighbor]) {
                    isGood = false;
                    break;
                }
            }
            if (isGood) {
                count++;
            }
        }

        System.out.println(count);
    }
}

import java.util.Scanner;

public class Main {
    public static void main(String[] args) {
        Scanner sc = new Scanner(System.in);
        int A = sc.nextInt();
        int B = sc.nextInt();
        int C = sc.nextInt();
        int D = sc.nextInt();

        int takahashiTurns = (C + B - 1) / B;
        int aokiTurns = (A + D - 1) / D;

        if (takahashiTurns <= aokiTurns) {
            System.out.println("Yes");
        } else {
            System.out.println("No");
        }
    }
}

